import React from 'react';
import './App.css';

function App() { 
  return (
    <div className="App">
     <canvas id="canvas"></canvas>
    </div>
  );
}

export default App;
const canvas = document.querySelector('#canvas');
const ctx = canvas.getContext('2d');
canvas.height = window.innerHeight;
